import React from 'react'

function Pagination({ filterdDishes , itemsperPage , currentPage , setCurrentPage}) {

    let numberofPages=[]

    for(let i=1; i<=Math.ceil(filterdDishes.length/itemsperPage); i++){
        numberofPages.push(i)

    }

    function currentpageseter(event){
        let currentPage = event
        setCurrentPage(currentPage)

    }
    console.log('current page is =',currentPage);

    let page= numberofPages.map((pageNumber)=>{
        return(
            <div id={pageNumber} onClick={(e)=>currentpageseter(e.target.id , pageNumber )}>
            <li  className={pageNumber === currentPage }>
                 {pageNumber}
            </li>
            </div>
        )
    })

  return (
    <section>

              <ul className='pagination flex'>
                  {page}
              </ul>


    </section>

  )
}

export default Pagination
